package com.taoxiha.service.crawl.entity;import java.io.Serializable;public class Cookie implements Serializable{	private static final long serialVersionUID = 1L;		private  String domain;	private  String name;	private  String value;	private  String path;	private  int maxAge;	private  boolean secure;	private  String comment;	private  String commentUrl;		public Cookie(){}		public Cookie(String domain, String name, String value, String path,			int maxAge, boolean secure) {		this.domain = domain;		this.name = name;		this.value = value;		this.path = path;		this.maxAge = maxAge;		this.secure = secure;	}	public String getDomain() {		return domain;	}	public void setDomain(String domain) {		this.domain = domain;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getValue() {		return value;	}	public void setValue(String value) {		this.value = value;	}	public String getPath() {		return path;	}	public void setPath(String path) {		this.path = path;	}	public int getMaxAge() {		return maxAge;	}	public void setMaxAge(int maxAge) {		this.maxAge = maxAge;	}	public boolean isSecure() {		return secure;	}	public void setSecure(boolean secure) {		this.secure = secure;	}	public String getComment() {		return comment;	}	public void setComment(String comment) {		this.comment = comment;	}	public String getCommentUrl() {		return commentUrl;	}	public void setCommentUrl(String commentUrl) {		this.commentUrl = commentUrl;	}				}